import React from 'react';
import { View, Text } from 'react-native';

const DetailScreen: React.FC = () => {
  return (
    <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
      <Text>Detail Screen</Text>
    </View>
  );
}

export default DetailScreen;
